import React from 'react'
import NavBar from '../components/NavBar'
import {connect} from 'react-redux'

class EditPrivateJoke extends React.Component{
    constructor(props) {
        super(props)
        this.state = {
            joke: ''
        }
    }

    render() {
        const joke = this.props.privateJokes[this.props.match.params.id].joke
        return (
            <div>
                <NavBar />
        <p>Edit {joke}</p>
            </div>
        )
    }
}

const mapStateToProps = state => ({
    privateJokes: state.privateJokes
})

export default EditPrivateJoke
